import React from 'react';
import { Card,Statistic, Row, Col, Button } from 'antd';
import './App.css';

class CurrencyCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Buycb:0.0,
            Sellcb:0.0,
            Buygemini:0.0,
            Sellgemini:0.0,
            bestSeller:"Gemini",
            bestSP:0.0,
            bestBuyer:"Gemini",
            bestBP:0.0}
          };

    componentDidMount() {
        const req = new Request("http://localhost:8080/getCurrency?currencyType="+this.props.type, {
            method: 'GET',
            cache: 'default'
          });
    fetch(req,
    {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }

      })
      .then((response) => {
          return response.clone().json()
        }
          )
      .then((data) => {
        this.setState({
            Buycb:data["Buycb"],
            Sellcb:data["Sellcb"],
            Buygemini:data["Buygemini"],
            Sellgemini:data["Sellgemini"],
            bestSeller:data["bestSeller"],
            bestSP:data["bestSP"],
            bestBuyer:data["bestBuyer"],
            bestBP:data["bestBP"]}
            );
        })

    };

    render() {
        const { Buycb, Sellcb,Buygemini,Sellgemini,bestSeller,bestSP,bestBuyer,bestBP} = this.state

            return (
            <div>
            <div className="insideCard">
                <div  className="subCard">
                    <h4>Coinbase Exchange</h4>
                     <Row gutter={16}>
                        <Col span={12}>
                        <Statistic title="Buy Price" value={Buycb} />
                        </Col>
                        <Col span={12}>
                        <Statistic title="Sell Proce" value={Sellcb} />

                        </Col>
                    </Row>
                </div>

                <div  className="subCard" >
                    <h4>Gemini Exchange</h4>
                     <Row gutter={16}>
                        <Col span={12}>
                        <Statistic title="Buy Price" value={Buygemini} />
                        </Col>
                        <Col span={12}>
                        <Statistic title="Sell Proce" value={Sellgemini} />

                        </Col>
                    </Row>
                </div>
            </div>
            <div className="insideCard">
                <Card title="Suggestion">
                    <p>
                    <br />
                            Best<b> BUYING</b> price is {bestBP} available at {bestBuyer}

                            <br />
                            Best<b> SELLING</b> price is {bestSP} available at {bestSeller}

                    </p>
                </Card>
            </div>

            </div>
            );
            }
    }

export default CurrencyCard;
